import React from "react";
import classes from "./Selectors.module.css";

export default function SelectTypeItems({ setType }) {
  return (
    <div className={classes.type}>
      <button
        onClick={() => {
          setType("donate");
        }}
      >
        Привилегии
      </button>
      <button
        onClick={() => {
          setType("cases");
        }}
      >
        Кейсы
      </button>
      <button
        onClick={() => {
          setType("items");
        }}
      >
        Предметы
      </button>
    </div>
  );
}
